import Layout from '../layout/layouts';
import Isi from '../komponen/isi';



class Main extends React.Component{
    render(){
        return(
            <Layout>
            <div class="data">
            <section >
                <div id="Bioskop" class="view"><h2>Bioskop</h2> <link href="/proyek/bioskop"><a><strong>view all :</strong></a></link></div>

                <Isi />

            </section>

        </div>

        </Layout>
        )
    }
}

export default Main;
